import React from 'react'
import Itemcard from './Itemcard'
import Items from './Items'
import './Stock.css'

function Stock() {


  return (
    <div className ="stock">
        {Items.data.map((item,index) =>{
            return (
                <Itemcard 
                img = {item.img} 
                item ={item} 
                title={item.title} 
                price={item.price} 
                key={index} 
                desc ={item.desc}/>
            )
        })}

    </div>
  )
}

export default Stock
